The first and most embarassingly simple of which is Box. Box is a collection of exactly one item. (It can't even be empty) It's just a wrapper around a generic value. If you were to implemente Box in Java it would look like this: class Box<T> implements Iterable<T> { private final T item; public Box(T item) { this.item = item; } public Item getItem() { return item; } @Override public Iterator<Item> iterator() { //... }
} You may be wondering: "Why would I ever need such a useless class?". Usually you don't. But it comes up as a to work around some restrictions. These cases will be explained when they come up. Declaring a box is done like this: let boxed = Box::new(1);
// or if you want to be explicet about the type
let boxed2 : Box<i32> = Box::new(2); The :: operator in the example above acutally does exactly the same thing it does in Java. It is how you can refer to a static method without invoking it. IE: Arrays.sort(stringArray, String::compareToIgnoreCase); but in Rust, once you have a method reference instead of calling method.run() or method.call(arg) you can just invoke it: method() or method(arg). So Box::new refers to the constructor of Box just like it would in Java, and the (1) following it invokes the method passing the argument 1.

