Borrowing is not just for parameters, it is also for returned values. The simplest case is where the returned value is derived from an input parameter. For example: # struct Foo { bar: Bar }
# struct Bar {}
fn get_bar(foo: &Foo) -> &Bar { &foo.bar
} Another case is where the value being returned comes from 'self’ and is being lent to the caller. For example: # struct Bar {}
struct Foo { bar: Bar }
impl Foo { fn get_bar(&self) -> &Bar { &self.bar }
} In both these cases the caller is bound by the contract of borrowing, exactly the same as though it were provided as an input parameter. If it helps, imagine the rest of the function were factored out into a private method and had the result as a borrowed parameter. For example: # struct Foo { bar: Bar }
# struct Bar {}
impl Foo { fn get_bar(&self) -> &Bar { &self.bar }
}
fn process_foo(foo: &Foo) { let bar = foo.get_bar(); process_bar(bar);
} This is equivalent to: # struct Foo { bar: Bar }
# struct Bar {}
fn process_foo(foo: &Foo) { process_bar(&foo.bar);
} When returning borrowed values it is occasionally ambiguous where the returned value came from. 99% of the time the compiler will work it out automatically. But sometimes there are cases that aren't so clear. For example here the compiler won't be able to work it out, because it only looks at one method at a time. fn function_with_two_inputs(arg1: &Something, arg2: &SomethingElse) -> &Output { //...
} In such a case you can label your inputs. Like so: # struct Something();
# struct SomethingElse();
# struct Output();
fn function_with_two_inputs(arg1: &'a Something, arg2: &'b SomethingElse) -> &'a Output { //...
} (Usually 'a, 'b, 'c, etc are used.) And the apply the same label to the output. In this case it is indicating that the output is derived from the first input and not the second. So it is explicit which input you intend the output to have come from. (The compiler will still check to make sure the labels are correct.) This also happens to be the same syntax that you would use to label loops for the break and continue keywords, which work similar to Java: # struct Item();
# fn is_bad(item: &Item) -> bool { true }
fn labeled_loops(collection: &Vec<Vec<Item>>) -> bool { 'outer: for group in collection { 'inner: for item in group { if (is_bad(item)) { break 'outer; } //... } //... } return false;
} In the above case the thing being labeled is the loop. In the first case the thing being labeled is the lifetime of the borrow. It is also possible to have a generic lifetime. This is useful for cases where which parameter a returned value is derived from is not known at compile time. For example: ///Returns the longer of two strings.
fn get_longer<'a>(a: &'a str, b: &'a str) -> &'a str { if a.len() > b.len() { a } else { b }
}

